import { useState } from "react";
import "./Form.css";
import Axios from "axios";

function Form() {
  return (
    <form>
      <div>
        <label>Lot</label>
        <input
          type="password"
          required
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
      </div>
    </form>
  );
}

export default Form;
